
//N 찍기
import java.util.Scanner;

public class Q2741 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int n = sc.nextInt();// 몇개입력받을지
		for (int i = 0; i < n; i++) {
			System.out.println(i + 1);// 1부터 n까지 출력
		}
		sc.close();
	}

}
